import React, { Component } from 'react';
import { Form, FormGroup, Col, Input, Label, Button, Container, CardBody, Card, CardText, Row } from 'reactstrap'
import '../../App.css';
import '../../index.css'
import Image from 'react-bootstrap/Image'


class StudentProfile extends Component {
  
    constructor(props) {
      super()
      this.state = {student: JSON.parse( sessionStorage.getItem('student')) }
      console.log(this.state)
    }

    render() {
        return (
          <Container>

                <div classname="studentform">
                <br/>
                <br/>        
                <br/>
                <br/>
                <br/>
                <br/>
                <h3> {this.state.student.firstname} {this.state.student.lastname}  </h3>

               
                <Col xs={6} md={4}>
                <Image src="" thumbnail />
                </Col>
              

                <Card >
                  <Card.Body style={{border:"none", top:'0px',bottom:'10px',width: '900px'}}>
                    <p>Location: {this.state.student.location}</p>
                    <p>Date of Birth: {this.state.student.dateofbirth}</p>
                    <p>Email: {this.state.student.email}</p>
                    <p>School Program: {this.state.student.schoolprogram}</p>
                    
                  </Card.Body>
                </Card>            

                </div>

                
  </Container>

        );
    }
}

export default StudentProfile;
